import React from 'react';
import { 
  LineChart, 
  Line 
} from 'recharts';

const MyLineChart = () => {
  const data = [
    { name: 'Engagement', engagement_level: 1 },
    { name: 'Engagement', engagement_level: 1 },
    { name: 'Engagement', engagement_level: 0 },
  ];

  return (
    <LineChart
      width={"50vh"}
      height={"50vh"}
      data={data}
    >
      <Line type="monotone" dataKey="engagement_level" stroke="#8884d8" />
    </LineChart>
  );
};

export default MyLineChart;
